import { Route } from "react-router-dom";
import Welcome from "./Pages/Welcome";
import Product from "./Pages/Product";
import MainPage from "./components/MaainPage";

function App() {
  return (
    <div>
      <MainPage />
      <Route path="/welcome">
        <Welcome />
      </Route>

      <Route path="/product">
        <Product />
      </Route>
    </div>
  );
}

export default App;
